window.bookSummaryJSON = "<p><b>Yesterday a wannabe pro-gamer, today an alien admiral.</b> </p> <p>Evan was desperate to hit the big time playing Star Commander, the world’s most popular real-time strategy game. While Evan works hard to get the pros to notice him, it's very different eyes that are captivated by Evan's progress. </p> <p>The Kirran Hegemony is at war. Outclassed at every step, the aliens turn to the most warlike race they know - humanity! Abducted from Earth, Evan finds himself fighting for his life, using his skills to command Hegemony forces in desperate battle. </p> <p>Now, helped by fellow humans, Evan must prove victory can be grasped from the jaws of impossible odds.</p>"; 
